import React from 'react'
import { Container, Row, Col } from 'react-bootstrap';
import TrackVisibility from 'react-on-screen';
import 'animate.css';
import gitIcon from '../img/logo.png'

export default function Banner() {
    return (
        <div className='banner' id='aboutMe'>
            <TrackVisibility>
                {({ isVisible }) =>
                    <div className={isVisible ? 'animate__animated animate__fadeIn' : 'notShowGreeting'}>
                        <h1>WEITAO WU</h1>
                        <h2>I AM A</h2>
                        <h3>New Grad Software Developer</h3>
                    </div>}
            </TrackVisibility>
            <TypeAnimation sequence={[
                        'New Grad', 2000,
                        'Software Developer',2000,
                    ]} speed={20} repeat={Infinity} className='Title'></TypeAnimation>
        </div>
    )
}
